import React from "react";

const items = [
  "https://images.unsplash.com/photo-1563720223185-11003d516935?q=80&w=1200&auto=format&fit=crop",
  "https://images.unsplash.com/photo-1602526432604-cb4d4501c6e0?q=80&w=1200&auto=format&fit=crop",
  "https://images.unsplash.com/photo-1573496359142-b8d87734a5a2?q=80&w=1200&auto=format&fit=crop",
  "https://images.unsplash.com/photo-1542291026-7eec264c27ff?q=80&w=1200&auto=format&fit=crop",
  "https://images.unsplash.com/photo-1518770660439-4636190af475?q=80&w=1200&auto=format&fit=crop",
  "https://images.unsplash.com/photo-1581090700227-1e37b190418e?q=80&w=1200&auto=format&fit=crop",
  "https://images.unsplash.com/photo-1581091870622-2d4a6d9c1e33?q=80&w=1200&auto=format&fit=crop",
  "https://images.unsplash.com/photo-1505740420928-5e560c06d30e?q=80&w=1200&auto=format&fit=crop",
  "https://images.unsplash.com/photo-1527430253228-e93688616381?q=80&w=1200&auto=format&fit=crop"
];

export default function Products(){
  return (
    <section id="prod" className="section">
      <div className="container">
        <h2>Продукция</h2>
        <div className="grid cols-3">
          {items.map((src, i) => (
            <figure className="product-card" key={i}>
              <img src={src} alt={`Товар ${i+1}`} />
            </figure>
          ))}
        </div>
      </div>
    </section>
  );
}
